from typing import List
from collections import Counter, defaultdict
class Solution:
    def findSubstring(self, s: str, words: List[str]) -> List[int]:

        if not s or not words or not words[0]:
            return []
        
        wlen = len(words[0])
        number_of_words = len(words)
        total_len = wlen * number_of_words
        string_chars = len(s)
        if total_len > string_chars:
            return []

        need = Counter(words)
        res: List[int] = []

        # We scan wlen different offsets to respect word boundaries.
        for offset in range(wlen):
            left = offset
            count = 0
            window = defaultdict(int)

            # step through in chunks of wlen
            for right in range(offset, string_chars - wlen + 1, wlen):
                word = s[right:right + wlen]

                if word in need:
                    window[word] += 1
                    count += 1

                    # Shrink from the left while this word is overused
                    while window[word] > need[word]:
                        left_word = s[left:left + wlen]
                        window[left_word] -= 1
                        left += wlen
                        count -= 1

                    # Full match found
                    if count == number_of_words:
                        res.append(left)
                        # Move left by one word to look for the next match
                        left_word = s[left:left + wlen]
                        window[left_word] -= 1
                        left += wlen
                        count -= 1
                else:
                    # Reset window if we hit a non-needed word
                    window.clear()
                    count = 0
                    left = right + wlen

        return res   
    
class Solution:
    def __call__(self, s: str, words: List[str]) -> List[int]:
        words_counter = Counter(words)
        words_counter_og = Counter(words)
        wlen, nwords = len(words[0]), len(words)
        
        res = []
        ic = 0
        is_f = False
        checkpoint = ic
        
        while ic < len(s):
            next_word_index = ic+(wlen)-1
            next_word = s[ic:next_word_index+1]
            
            if next_word in words_counter:
                if not is_f:
                    checkpoint = ic # starting point of matching first word
                    is_f = True
                
                words_counter[next_word] -= 1

                if words_counter[next_word] == 0:
                    del words_counter[next_word]
                
                if len(words_counter) == 0:
                    res.append(ic-(nwords-1)*wlen)
                    words_counter = words_counter_og.copy()
                    ic = checkpoint+1
                    is_f = False
                    continue
                        
                ic = next_word_index
            else:
                words_counter = words_counter_og.copy()

                if is_f:
                    ic = checkpoint+1
                    is_f = False
                    continue
            ic += 1        

            if next_word_index >= len(s):
                break
            
        return res
            
        
